from ctypes import *


libCalc = CDLL('/opt/fbi-base/lib/libmbase64.so')

libCalc.c_base64_decode.argtypes = [c_char_p]
libCalc.c_base64_decode.restype = POINTER(c_char)

def b64decode(src):
	p = libCalc.c_base64_decode(src.encode("utf-8"))
	ret = cast(p, c_char_p).value
	return ret



